import React from "react";
import "../assets/styles.css";
import "../assets/home-dark.css";

import logoNuevo from "../assets/img/logonuevo.png";
import lootroomTextLogo from "../assets/img/lootroomlogo.png";
import syvarLogo from "../assets/img/syvarlogo.png";
import rustypotTextLogo from "../assets/img/rustypotlogo.png";

export default function Home() {
  React.useEffect(() => {
    document.body.classList.add("has-video-bg");
    return () => document.body.classList.remove("has-video-bg");
  }, []);

  return (
    <div
      className="home-dark has-video-bg"
      style={{
        minHeight: "100vh",
        display: "flex",
        flexDirection: "column",
        alignItems: "center",
        justifyContent: "flex-start",
        padding: "1vh 0 2vh",
        gap: "1vh",
      }}
    >
      <main
        className="home-hero"
        style={{
          display: "flex",
          flexDirection: "column",
          alignItems: "center",
          justifyContent: "flex-start",
          gap: "1rem",
          paddingTop: 0,
        }}
      >
        <img
          className="home-hero-logo"
          src={logoNuevo}
          alt="Rustaco"
          style={{ width: "min(72vw, 520px)" }}
        />
        <p
          style={{
            margin: 0,
            fontSize: "1.6rem",
            fontWeight: 900,
            letterSpacing: "8px",
            textTransform: "uppercase",
            color: "#ffffffeb",
            textShadow: "0 8px 30px rgba(0,0,0,0.8)",
          }}
        >
          Pr√≥ximamente...
        </p>
      </main>

      <footer
        style={{
          width: "100%",
          maxWidth: 720,
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
          gap: 28,
          padding: "0.0rem 1.6rem",
          marginTop: "-1vh",
          flexWrap: "wrap",
        }}
      >
        <img
          src={syvarLogo}
          alt="Syvar"
          style={{ width: 150, height: "auto", objectFit: "contain" }}
        />
        <img
          src={lootroomTextLogo}
          alt="Lootroom"
          style={{ width: 170, height: "auto", objectFit: "contain" }}
        />
        <img
          src={rustypotTextLogo}
          alt="Rustypot"
          style={{ width: 150, height: "auto", objectFit: "contain" }}
        />
      </footer>
    </div>
  );
}
